import React from 'react';
// import styled from 'styled-components';
import { Link } from 'react-scroll';

//styles
import HeaderContainer from '../../../styles/02_tools/styled_component/components/HeaderContainerStyle';
import { Note } from '../../../styles/02_tools/styled_component/components/Fonts';

import HeaderLogo from './HeaderLogo';

function Header(props) {
  return (
    <HeaderContainer className="header" id="top">
      <div className="header-left">
        <HeaderLogo color={'#888'} />
      </div>
      <nav className="header-center">
        {props.first && (
          <Note className="section">
            <Link
              activeClass="active"
              to={props.first}
              spy={true}
              smooth={true}
              offset={-60}
              duration={500}
            >
              {props.first}
            </Link>
          </Note>
        )}
        {props.second && (
          <Note className="section">
            <Link
              activeClass="active"
              to={props.second}
              spy={true}
              smooth={true}
              offset={-60}
              duration={500}
            >
              {props.second}
            </Link>
          </Note>
        )}
        {props.third && (
          <Note className="section">
            <Link
              activeClass="active"
              to={props.third}
              spy={true}
