              offset={-60}
              duration={500}
            >
              {props.third}
            </Link>
          </Note>
        )}
        {props.fourth && (
          <Note className="section">
            <Link
              activeClass="active"
              to={props.fourth}
              spy={true}
              smooth={true}
              offset={-60}
