              offset={-60}
              duration={500}
            >
              {props.sixth}
            </Link>
          </Note>
        )}
        {props.seventh && (
          <Note className="section">
            <Link
              activeClass="active"
              to={props.seventh}
              spy={true}
              smooth={true}
              offset={-60}
              duration={500}
            >
              {props.seventh}
            </Link>
          </Note>
        )}
        {props.eighth && (
          <Note className="section">
            <Link
              activeClass="active"
              to={props.eighth}
              spy={true}
              smooth={true}
              offset={-60}
              duration={500}
            >
              {props.eighth}
            </Link>
          </Note>
        )}
      </nav>
      <div className="header-right">{/* <DarkMode /> */}</div>
    </HeaderContainer>
  );
}

export default Header;
